CREATE TABLE IF NOT EXISTS `QuestLinkResource` (
	`npc_id` int(11) NOT NULL,
	`quest_id` int(11) NOT NULL,
	`flag_start` tinyint(4) unsigned NOT NULL,
	`flag_progress` tinyint(4) unsigned NOT NULL,
	`flag_end` tinyint(4) unsigned NOT NULL,
	`text_id_start` int(11) NOT NULL,
	`text_id_in_progress` int(11) NOT NULL,
	`text_id_end` int(11) NOT NULL
) ENGINE=MyISAM;

